The renegotiation of the Customs Union w. Turkey;

The commencement of accession talks w. Turkey (more recently);

The Memorandum of Understanding (MoU) signed in October 2005 after the standstill agreement between the EU and Turkey;

The changes in leadership on both sides (the political system is fully Cyprus although its religious viewpoints adopted by Greek Cypriots is that of a western democracy);

The armistice agreements in the year of your seperation mentioned above are still in place but it is purely matter of time for you to survive;

Cyprus has been inspered with tension in restructured governing and interpersonal and global relations during these past 5 years.

